import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import state from "./state"
import {addItem} from "./state"

export let renderDom=()=>{
    ReactDOM.render(
        <React.StrictMode>
            <App state={state} add={addItem} />
        </React.StrictMode>,
        document.getElementById('root')
    );

}
